import { Route, BrowserRouter as Router, Switch, Redirect } from "react-router-dom";
import CreateAndEditUser from './components/CreateAndEditUser'


const App = () => {
  return (
    <Router>

      <Switch>
        <Route path="/create-user" component={CreateAndEditUser} />
        <Route path="/view-user">
          <h1>view user</h1>
        </Route>
        <Route path="/edit-user">
          <h1>Edit user</h1>
        </Route>
        <Redirect from="/" to="/create-user" />
      </Switch>

    </Router>
  );
}
export default App;
